import React, { useState } from 'react';
import './Fiies_Css/Register.css';

const Register = () => {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [birthDay, setBirthDay] = useState('1');
    const [birthMonth, setBirthMonth] = useState('1');
    const [birthYear, setBirthYear] = useState('2000');
    const [gender, setGender] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log({
            firstName,
            lastName,
            email,
            password,
            birthDay,
            birthMonth,
            birthYear,
            gender
        });
        // כאן אפשר להוסיף קוד לרישום המשתמש למערכת
    };

    return (
        <div className="register-container">
            <div className="register-box">
                <h2>הרשמה</h2>
                <p>זה מהיר וקל.</p>
                <form onSubmit={handleSubmit}>
                    <div className="input-group">
                        <input
                            type="text"
                            placeholder="שם פרטי"
                            value={firstName}
                            onChange={(e) => setFirstName(e.target.value)}
                            required
                        />
                        <input
                            type="text"
                            placeholder="שם משפחה"
                            value={lastName}
                            onChange={(e) => setLastName(e.target.value)}
                            required
                        />
                    </div>
                    <input
                        type="email"
                        placeholder="מספר נייד או דוא\ל"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        required
                    />
                    <input
                        type="password"
                        placeholder="סיסמה חדשה"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        required
                    />
                    <div className="birthdate">
                        <label>תאריך לידה:</label>
                        <div className="input-group">
                            <select value={birthDay} onChange={(e) => setBirthDay(e.target.value)} required>
                                {[...Array(31).keys()].map(day => (
                                    <option key={day + 1} value={day + 1}>{day + 1}</option>
                                ))}
                            </select>
                            <select value={birthMonth} onChange={(e) => setBirthMonth(e.target.value)} required>
                                {[...Array(12).keys()].map(month => (
                                    <option key={month + 1} value={month + 1}>{month + 1}</option>
                                ))}
                            </select>
                            <select value={birthYear} onChange={(e) => setBirthYear(e.target.value)} required>
                                {[...Array(120).keys()].map(year => (
                                    <option key={2024 - year} value={2024 - year}>{2024 - year}</option>
                                ))}
                            </select>
                        </div>
                    </div>
                    <div className="gender">
                        <label>מין:</label>
                        <div className="input-group">
                            <label>
                                <input
                                    type="radio"
                                    value="זכר"
                                    checked={gender === 'זכר'}
                                    onChange={() => setGender('זכר')}
                                    required
                                /> זכר
                            </label>
                            <label>
                                <input
                                    type="radio"
                                    value="נקבה"
                                    checked={gender === 'נקבה'}
                                    onChange={() => setGender('נקבה')}
                                    required
                                /> נקבה
                            </label>
                            <label>
                                <input
                                    type="radio"
                                    value="התאמה אישית"
                                    checked={gender === 'התאמה אישית'}
                                    onChange={() => setGender('התאמה אישית')}
                                    required
                                /> התאמה אישית
                            </label>
                        </div>
                    </div>
                    <button type="submit" className="register-button">הרשמה</button>
                </form>
            </div>
        </div>
    );
};

export default Register;
